export default function Footer() {
  return (
    <footer style={{ background: '#222', color: '#fff', textAlign: 'center', padding: '1em 0', marginTop: '2em' }}>
      <p>&copy; {new Date().getFullYear()} KK Computers</p>
    </footer>
  );
}
